plr = {
	x = 16,
	y = 120,
	speed = 2,
	toLeft = 0,
	vx=0,
	vy=0,
	costume = 256
}

plrblt = {
x = 0,
y=0, 
active = false,
vx=0
}

gravity = 0.2

function TIC()

	cls()
	t = time()//10
	
	defaultMovement()
	shootPrjctl(t)
	map(0,0, 30,17)
	plrAnims(t)
end

function shootPrjctl(t)

	if plrblt.active then
		
		plrblt.x = plrblt.x + plrblt.vx
		
		if plrblt.x < 0 or plrblt.x > 232 then
			plrblt.active = false
		  else
			spr(10 + t%60//20, plrblt.x, plrblt.y)
		end
		
	elseif btnp(5) then
		 plrblt.active = true
			if plr.vx > 0 then
			plrblt.vx = plr.vx + plr.speed * 1.5
			elseif plr.toLeft >= 1 then
				plrblt.vx = (plr.vx - plr.speed) * 1.5
			else
				plrblt.vx = (plr.vx + plr.speed) * 1.5
			end
		
			if plr.vx > 0 then
			plrblt.x = plr.x
			else
			plrblt.x = plr.x
			
			end
			
		plrblt.y = plr.y
	end
end -- shoot Projectile

function directionOfPlayer()
	if btn(3) then
		plr.toLeft = 0
	elseif btn(2) then
		plr.toLeft = 1
	end
end

function plrAnims(t)
directionOfPlayer()
	if plr.vy > 0 then
			plr.costume = 273
			elseif btn(1) then
			plr.costume = 274
			elseif plrblt.active then
	 	plr.costume = 272
			else
			plr.costume = 256 + t%60//30
			end
			spr(plr.costume, plr.x, plr.y, -1, 1, plr.toLeft)
end

function defaultMovement()


	if btn(2) then
			plr.vx = -1 * plr.speed
		elseif btn(3) then
			plr.vx = plr.speed
		else
		plr.vx = 0
	end
	
	u= plr.y + plr.vy + 1
	d= plr.y + plr.vy + 7
	l= plr.x + plr.vx + 1
	r= plr.x + plr.vx + 7
	
	if plr.vx < 0 and (tileAt(l, u) or tileAt(l, d)) then
			plr.vx = 0
		elseif plr.vx > 0 and (tileAt(r, u) or tileAt(r, d)) then
			plr.vx = 0
	end
	
	if tileAt(l, d + 1) or tileAt(r, d + 1) then
			plr.vy = 0
		else
			plr.vy = plr.vy + gravity
	end
	
	if btn(0) and  plr.vy == 0 then
		plr.vy = -3
	end
	
	if plr.vy < 0 and (tileAt(l, u) or tileAt(r, u)) then
		plr.vy = 0
	end
	
	plr.x = plr.x + plr.vx
	plr.y = plr.y + plr.vy
	
end

function tileAt(x, y)

return mget(x//8, y//8) < 108

end

function randomLocation()

end
